INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 11300112, 9, 7, 1, 3001, 0, "vo_minigame_1012_result_1011", 1, 1, 3.47, 5, "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！");
