INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300114, 9, 7, 1, 3001, 10, "vo_minigame_1012_result_1013", 7, 1, 6.49, 8, "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300115, 9, 7, 1, 3001, 0, "vo_minigame_1012_result_1014", 1, 1, 3.56, 5, "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！");
