INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 11300119, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1018", 1, 1, 4.12, 3, "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？");
