INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 11300121, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1020", 1, 1, 3.15, 3, "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300122, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1021", 1, 1, 5.3, 9, "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300123, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1022", 1, 1, 2.55, 8, "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300124, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1023", 7, 1, 4.19, 1, "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 11300125, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1024", 1, 1, 3.43, 7, "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 11300126, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1025", 1, 1, 0.0, 1, "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 11300127, 6, 4, 1, 3001, 0, "vo_minigame_1012_result_1026", 7, 1, 3.72, 8, "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！");
