INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 11300129, 3, 1, 1, 3001, 1, "vo_minigame_1012_result_1028", 2, 1, 3.25, 4, "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 11300130, 3, 1, 1, 3001, 0, "vo_minigame_1012_result_1029", 2, 1, 4.62, 3, "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300131, 3, 1, 1, 3001, 0, "vo_minigame_1012_result_1030", 1, 1, 4.5, 9, "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！");
