INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300133, 3, 1, 1, 3001, 9, "vo_minigame_1012_result_1032", 9, 1, 0.01, 9, "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！");
