INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 11300136, 3, 1, 1, 3001, 0, "vo_minigame_1012_result_1035", 1, 1, 3.1, 3, "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 11300137, 0, 0, 1, 3001, 1, "vo_minigame_1012_result_1036", 2, 1, 4.31, 6, "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？");
