INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300140, 0, 0, 1, 3001, 0, "vo_minigame_1012_result_1039", 2, 1, 4.38, 3, "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300141, 0, 0, 1, 3001, 0, "vo_minigame_1012_result_1040", 2, 1, 3.58, 8, "あんたの点数は～～…\n…はい！　０てーん！！\n…って、ふざけんなーー！！！");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (2, 11300142, 0, 0, 1, 3001, 1, "vo_minigame_1012_result_1041", 2, 1, 2.02, 4, "０点ってどういうこと！？\nいやあんた、逆にすごいわよ！？\n目つぶってやったとしても\n１点は取れるから！");
